import React from "react";

const Container = styled.div`
  height: 300px;
  background-color: aliceblue;
`;

const AddContact = () => {
  return (
    <Container>
      <h2>Add Contact</h2>
      <form>
        <div>
          <label>Name</label>
          <input type="text" name="name" placeholder="Name" />
        </div>
      </form>
    </Container>
  );
};

export default AddContact;
